import React, { useEffect } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

// Particle background
const ParticleContainer = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  pointer-events: none;
  z-index: -1;
  overflow: hidden;
  background: radial-gradient(circle at 50% 50%, rgba(255, 255, 255, 0.1), transparent 50%);
`;

// Section container for experience
const ExperienceSection = styled.section`
  position: relative;
  background: linear-gradient(135deg, #ff9a9e 0%, #fad0c4 100%);
  padding: 4em 2em;
  text-align: center;
  overflow: hidden;
`;

// Title for the section
const Title = styled.h1`
  font-size: 3em;
  color: #fff;
  margin-bottom: 2em;
  text-transform: uppercase;
  letter-spacing: 3px;
  position: relative;
`;

// Floating Card container
const ExperienceList = styled(motion.div)`
  max-width: 900px;
  margin: 0 auto;
  display: flex;
  flex-direction: column;
  gap: 3em;
  perspective: 1000px; /* 3D perspective */
`;

// Individual experience card with floating effect
const ExperienceItem = styled(motion.div)`
  background: linear-gradient(135deg, #ff9a9e 0%, #00f260 100%);
  border-radius: 15px;
  padding: 3em;
  box-shadow: 0px 15px 25px rgba(0, 0, 0, 0.2);
  transition: transform 0.6s ease, box-shadow 0.6s ease;
  position: relative;
  background-size: 200% 200%;
  transform: rotate3d(1, 1, 1, 10deg);
  cursor: pointer;
  
  &:hover {
    transform: scale(1.2) rotate3d(1, 1, 1, 360deg);
    box-shadow: 0px 25px 50px rgba(0, 0, 0, 0.5);
    background-position: right center;
  }

  &:before {
    content: "";
    position: absolute;
    top: -10px;
    right: -10px;
    bottom: -10px;
    left: -10px;
    background: linear-gradient(135deg, rgba(255, 255, 255, 0.3), rgba(255, 255, 255, 0));
    z-index: -1;
    border-radius: 20px;
    filter: blur(10px);
  }
`;

// Rotating title for job roles
const JobTitle = styled.h3`
  font-size: 2.2em;
  color: #fff;
  font-weight: bold;
  margin-bottom: 0.5em;
  transition: color 0.5s ease;
  transform: rotate(0deg);

  ${ExperienceItem}:hover & {
    color: #ffd700; /* Gold-like futuristic color */
    transform: rotate(360deg); /* Rotate title on hover */
  }
`;

const Company = styled.h4`
  font-size: 1.5em;
  color: #fff;
  font-weight: bold;
  margin-bottom: 1em;
  transition: color 0.5s ease;
  transform: rotate(0deg);

  ${ExperienceItem}:hover & {
    color: #ffeb3b;
    transform: rotateY(360deg); /* Rotate company in 3D */
  }
`;

const Timeline = styled.h5`
  font-size: 1.1em;
  color: #ccc;
  margin-bottom: 1em;
`;

const Description = styled.p`
  font-size: 1.2em;
  color: #fff;
  line-height: 1.8;
  transform: perspective(400px);
  transition: transform 0.6s ease;

  ${ExperienceItem}:hover & {
    transform: scale(1.2) perspective(800px); /* Create a 3D text effect */
  }
`;

// Add particles or custom floating animations (optional)
const FloatingParticles = () => {
  useEffect(() => {
    // You can add a custom particle animation library here, or simple canvas animations.
  }, []);

  return <ParticleContainer />;
};

const Experience = () => {
  return (
    <ExperienceSection>
      <FloatingParticles />
      <Title>My Unique Experience</Title>
      <ExperienceList
        initial="hidden"
        animate="visible"
        variants={{
          hidden: { opacity: 0, y: 50 },
          visible: { opacity: 1, y: 0, transition: { duration: 1.2, ease: 'easeInOut', staggerChildren: 0.4 } },
        }}
      >
        {/* Experience Items */}
        <ExperienceItem>
          <JobTitle>DevOps & Full Stack</JobTitle>
          <Company>BOSCH Global Software Technologies</Company>
          <Timeline>Jul. 2023 - Present</Timeline>
          <Description>
            • Led Docker Containerization and auto-scaling of Kubernetes clusters.<br />
            • Architected CI/CD pipelines, slashing deployment times by 60%.<br />
          </Description>
        </ExperienceItem>

        <ExperienceItem>
          <JobTitle>Google Summer of Code</JobTitle>
          <Company>PEcAn Project</Company>
          <Timeline>Jun. 2022 - Sept 2022</Timeline>
          <Description>
            • Refactored R packages to enhance code compliance and quality.<br />
            • Improved package download speeds by 40% through optimization.<br />
          </Description>
        </ExperienceItem>
      </ExperienceList>
    </ExperienceSection>
  );
};

export default Experience;
